(1, 'Vais-je être rémunéré si je participe à l\'étude ?', '<p style=\"text-align: justify;\">Non, MobiliSense &eacute;tant une &eacute;tude enti&egrave;rement b&eacute;n&eacute;vole, les diff&eacute;rents acteurs ne sont pas r&eacute;mun&eacute;r&eacute;s pour cette derni&egrave;re. Vous participerez cependant &agrave; une &eacute;tude d\'&eacute;tat et vos donn&eacute;es seront r&eacute;cup&eacute;r&eacute;es pour &ecirc;tre utilis&eacute;es et rendre le monde meilleur !</p>', 1),
(3, 'Puis-je participer à l\'étude si je n\'habite pas à paris ?', '<p style=\"text-align: justify;\">L\'&eacute;tude se concentre pour le moment sur les habitants de toute l\'&icirc;le De France.<br />Cependant, cette derni&egrave;re n\'est pas encore ouvert au reste de la France, il faut donc habiter dans cette r&eacute;gion. Nous vous indiquerons d&egrave;s que l\'&eacute;tude sera accessible dans d\'autres grandes villes de France.</p>', 2);

