(14, 'Une planète verte ?', '<p><img src=\"data:image/jpeg;base64,\" alt=\"\" width=\"379\" height=\"526\" /></p>\r\n<p>Le monde change, et vous ?</p>', NULL, '2018-05-30');
INSERT INTO `news` (`id`, `title`, `description`, `files`, `date`) VALUES
(15, 'Une actualité avec un fichier', '<p style=\"text-align: justify;\">Coactique aliquotiens nostri pedites ad eos persequendos scandere clivos sublimes etiam si lapsantibus plantis fruticeta prensando vel dumos ad vertices venerint summos, inter arta tamen et invia nullas acies explicare permissi nec firmare nisu valido gressus: hoste discursatore rupium abscisa volvente, ruinis ponderum inmanium consternuntur, aut ex necessitate ultima fortiter dimicante, superati periculose per prona discedunt.</p>\r\n<p style=\"text-align: justify;\">Cyprum itidem insulam procul a continenti discretam et portuosam inter municipia crebra urbes duae faciunt claram Salamis et Paphus, altera Iovis delubris altera Veneris templo insignis. tanta autem tamque multiplici fertilitate abundat rerum omnium eadem Cyprus ut nullius externi indigens adminiculi indigenis viribus a fundamento ipso carinae ad supremos usque carbasos aedificet onerariam navem omnibusque armamentis instructam mari committat.</p>\r\n<p style=\"text-align: justify;\">Non ergo erunt homines deliciis diffluentes audiendi, si quando de amicitia, quam nec usu nec ratione habent cognitam, disputabunt. Nam quis est, pro deorum fidem atque hominum! qui velit, ut neque diligat quemquam nec ipse ab ullo diligatur, circumfluere omnibus copiis atque in omnium rerum abundantia vivere? Haec enim est tyrannorum vita nimirum, in qua nulla fides, nulla caritas, nulla stabilis benevolentiae potest esse fiducia, omnia semper suspecta atque sollicita, nullus locus amicitiae.</p>\r\n<p style=\"text-align: justify;\">Post hoc impie perpetratum quod in aliis quoque iam timebatur, tamquam licentia crudelitati indulta per suspicionum nebulas aestimati quidam noxii damnabantur. quorum pars necati, alii puniti bonorum multatione actique laribus suis extorres nullo sibi relicto praeter querelas et lacrimas, stipe conlaticia victitabant, et civili iustoque imperio ad voluntatem converso cruentam, claudebantur opulentae domus et clarae.</p>\r\n<p style=\"text-align: justify;\">Eodem tempore etiam Hymetii praeclarae indolis viri negotium est actitatum, cuius hunc novimus esse textum. cum Africam pro consule regeret Carthaginiensibus victus inopia iam lassatis, ex horreis Romano populo destinatis frumentum dedit, pauloque postea cum provenisset segetum copia, integre sine ulla restituit mora.</p>', 'files/IcdH5OvFg9l41Q9tu0mAVj3SwrJxCOllnaXFBQLc.pdf', '2018-05-29'),
(17, 'Article “Mobile Sensing in Environmental Health and Neighborhood Research” publié dans la revue “Annual Review of Public Health”', '<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt;\">La recherche en sant&eacute; publique a connu un d&eacute;veloppement rapide dans l\'utilisation de capteurs &agrave; haute r&eacute;solution. Ils mesurent des param&egrave;tres de types biophysiques, comportementaux, de g&eacute;olocalisation et d&rsquo;expositions environnementales, et fournissent des donn&eacute;es horodat&eacute;es objectives.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt;\">Ce domaine en plein essor est stimul&eacute; par le d&eacute;veloppement r&eacute;cent de dispositifs multi capteurs qui collectent des donn&eacute;es dans un nombre croissant de champs d&rsquo;application. En r&eacute;sultent des algorithmes qui r&eacute;alisent des pr&eacute;dictions pertinentes &agrave; partir d\'un ou plusieurs canaux de donn&eacute;es.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt;\">Le suivi par syst&egrave;me mondial de positionnement (GPS), qui effectue une &eacute;valuation g&eacute;ographique momentan&eacute;e, permet aux chercheurs d&rsquo;examiner les expositions personnelles &agrave; un niveau multi-lieux, et de r&eacute;aliser une identification algorithmique des d&eacute;placements et des lieux visit&eacute;s, &eacute;ventuellement valid&eacute;s et compl&eacute;t&eacute;s &agrave; l\'aide d\'une enqu&ecirc;te de mobilit&eacute; GPS.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt;\">Ces m&eacute;thodes ouvrent une nouvelle perspective d&rsquo;analyse dans le temps et dans l&rsquo;espace qui&nbsp;:</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; padding-left: 30px;\"><span style=\"font-size: 16px;\">&bull;&nbsp;</span><span style=\"font-size: 12.0pt;\">Tient compte de l&rsquo;ensemble des expositions momentan&eacute;es, qu&rsquo;elles soient r&eacute;sidentielles ou non r&eacute;sidentielles.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; padding-left: 30px;\"><span style=\"font-size: 16px;\">&bull; D</span><span style=\"font-size: 12.0pt;\">&eacute;compose spatialement et temporellement les variables comportementales et de sant&eacute; &eacute;tudi&eacute;es, les repla&ccedil;ant ainsi dans leur contexte environnemental imm&eacute;diat.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; padding-left: 30px;\"><span style=\"font-size: 16px;\">&bull; Examine des s&eacute;quences temporelles complexes</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; padding-left: 30px;\"><span style=\"font-size: 16px;\">&bull; E</span><span style=\"font-size: 12.0pt;\">xplore l\'interaction entre des indicateurs individuels, environnementaux et situationnels.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; padding-left: 30px;\"><span style=\"text-indent: 3pt; font-size: 16px;\">&bull; R</span><span style=\"text-indent: 3pt; font-size: 12pt;\">&eacute;alise des analyses de segments de vie, en construisant des unit&eacute;s statistiques infra-individuelles et en utilisant des mod&egrave;les de cas-crois&eacute;.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; padding-left: 30px;\"><span style=\"text-indent: 3pt;\"><span style=\"font-size: 16px;\">&bull; A</span></span><span style=\"font-size: 16px; text-indent: 47.2px;\">boutissent &agrave; des recommandations pour des interventions &laquo;&nbsp;juste-&agrave;-temps&nbsp;&raquo;.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal; mso-layout-grid-align: none; text-autospace: none;\"><strong><span lang=\"EN-US\" style=\"font-size: 10.0pt; mso-bidi-font-family: JansonText-Roman; mso-ansi-language: EN-US;\">Abstract</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><span lang=\"EN-US\" style=\"font-size: 10.0pt; mso-bidi-font-family: JansonText-Roman; mso-ansi-language: EN-US;\">Public health research has witnessed a rapid development in the use of location, environmental, behavioral, and biophysical sensors that provide high-resolution objective time-stamped data. This burgeoning field is stimulated by the development of novel multisensor devices that collect data for an increasing number of channels and algorithms that predict relevant dimensions from one or several data channels. Global positioning system (GPS) tracking, which enables geographic momentary assessment, permits researchers to assess multiplace personal exposure areas and the algorithmbased identification of trips and places visited, eventually validated and complemented using a GPS-based mobility survey. These methods open a new space-time perspective that considers the full dynamic of residential and nonresidential momentary exposures; spatially and temporally disaggregates the behavioral and health outcomes, thus replacing them in their immediate environmental context; investigates complex time sequences; explores the interplay among individual, environmental, and situational predictors; performs life-segment analyses considering infraindividual statistical units using case-crossover models; and derives recommendations for just-in-time interventions.</span></p>', 'files/AaduarS7yMHGibQPzubOwhTzEpa7JPZOoW5jgK8N.pdf', '2018-05-31');

